import classes from "./Dialogs.module.css";
import {NavLink} from "react-router-dom";

type DialogItemProps = {
    name: string
    id: string
}

const DialogItem = (props: DialogItemProps) => {
    return (
        <div className={classes.dialog + " " + classes.active}>
            <NavLink to={"/dialogs/" + props.id}>{props.name}</NavLink>
        </div>

    )
}


export const Dialogs = () => {
    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItems}>
                <DialogItem name='Alex'
                            id='1'/>
                <div className={classes.dialog}>
                    <NavLink to='/dialogs/3'>Vasile</NavLink>
                </div>
                <div className={classes.dialog}>
                    <NavLink to='/dialogs/4'>Michael</NavLink>
                </div>
                <div className={classes.dialog}>
                    <NavLink to='/dialogs/5'>Gaby</NavLink>
                </div>
                <div className={classes.dialog}>
                    <NavLink to='/dialogs/6'>Lory</NavLink>
                </div>
            </div>
            <div className={classes.messages}>
                <div className={classes.dialog}>Hi, how are you?</div>
                <div className={classes.dialog}>Thank you</div>
                <div className={classes.dialog}>Why</div>
            </div>
        </div>
    )
}
